import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import './PastResultsPage.css'; // CSS for PastResultsPage

const PastResultsPage = () => {
  const [pastResults, setPastResults] = useState([]);

  useEffect(() => {
    const fetchPastResults = async () => {
      try {
        const response = await axios.get('/api/past-results');
        setPastResults(response.data);
      } catch (error) {
        console.error('Error fetching past results:', error);
      }
    };

    fetchPastResults();
  }, []);

  return (
    <div className="past-results-page">
      <header>
        {/* Your header here */}
      </header>
      <main>
        <h2>Past Results</h2>
        <div className="results-grid">
          {pastResults.length > 0 ? (
            pastResults.map(result => (
              <div key={result.id} className="result-item">
                <Link to={`/result/${result.id}`}>
                  <img src={`./user_upload/${result.file_name}`} alt={result.file_name} />
                </Link>
                <div className="result-details">
                  <p>Completed scan</p>
                  {/* Add more details if needed */}
                </div>
              </div>
            ))
          ) : (
            <p>No past results found.</p>
          )}
        </div>
      </main>
    </div>
  );
};

export default PastResultsPage;
